import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getUserDataByBirthDay } from "../../Redux/Features/userReqests/getUserData";


function GetUsersData(){
    const dispatch = useDispatch();
    const userData = useSelector((state)=>state.getUsersDataByBirthday.userDataState);
    useEffect(()=>{
        dispatch(getUserDataByBirthDay('2005-05-16'));
    },[])
    console.log(userData);
    return(<></>)
}
export default GetUsersData;
